description:
Beautiful reserved therapist Vanilla DeVille sees a variety of patients throughout the day, each of them struggling with forbidden desires. Evan Stone is a narcissistic televangelist who can't resist the charms of his busty assistant, Sophie Dee. Pathological liar Rocco Reed recounts an incestuous afternoon with his &quot;sister,&quot; blonde teen Chastity Lynn. And Vanilla struggles with her own repressed lust for hot young patient Seth Gamble, who torments her with tales of his recent tryst with Dyanna Lauren. When Vanilla goes home to jealous boytoy Michael Vegas, he questions her about Seth, so Vanilla pulls out all the stops to give him the sexual reassurance he needs. Explosive, real sex, real positions, and the best storyline and dialogue found in any feature studio today, The Psychotherapist is a classic you'll watch over and over again. Written and directed by Nica Noelle

